- input: "TEXT\x1CC00016899\x1CTEXT-00001\x1CFEC-308013\x1CF3XA\x1CThe H4 payments
    for various tax payments were for employees who dind not spend more than 25% of
    their time on Federal election activity. No FEA has been added to these individual
    descriptions. The legal service payments were not to an employee. The Voter File
    CD Update was exclusively for a part of the voter file (Summit County) that is
    not part of the 5th District of Ohio and was not associated with that election.
    The Data Purchase was for demographic data for the entire state that was tied
    to census blocks and individual precincts, but not for individual voters. Only
    5-6% of this data affected the 5th District of Ohio Special Election. However,
    since there is an argument that this data may be used to infer how individual
    voters may vote, we have decided to amend the report and transfer the H3 reimbursement
    back to the non-federal account. This transfer was made on March 20, 2008 in the
    amount of $11,520 and will be reflected in our April Monthly 2008 Report. The
    payments for the Fundraising Consultant was for fundraising efforts exclusively
    on behalf of the Ohio Democratic Party and not on behalf of any federal candidates."
